import React from "react";

const Home = () => {
  return (
    <div className='mb-20'>
      <h1 className='sm:text-4xl text-2xl font-bold my-6 text-gray-900'>
        Hello, Welcome to ReactifyHub
      </h1>
      <p className='mx-auto leading-relaxed text-base mb-4'>
      At ReactifyHub, we're passionate about ReactJS and dedicated to fostering a thriving community of developers who share our enthusiasm for this powerful JavaScript library. Whether you're just starting your journey with React or you're a seasoned pro, ReactifyHub is your go-to destination for all things React.
      </p>
      <p className='mx-auto leading-relaxed text-base mb-4'>
      Looking to sharpen your React skills? Dive into our collection of in-depth tutorials designed to cater to developers of all levels. From React fundamentals to advanced techniques, our tutorials cover a wide range of topics to help you master React and stay up-to-date with the latest best practices.
      </p>
      <p className='mx-auto leading-relaxed text-base mb-4'>
      Put your newfound React knowledge to the test by building real-world projects. Our project-based learning approach provides hands-on experience and practical insights as you work through a variety of projects, from simple to complex. Whether you're building a todo app, an e-commerce site, or a social media platform, ReactifyHub has the resources you need to bring your ideas to life.
      Join our vibrant community of React developers and enthusiasts from around the world. Engage in discussions, ask questions, and share your experiences as you connect with like-minded individuals who are passionate about React. Whether you're seeking advice, collaborating on projects, or simply looking to network, ReactifyHub provides a welcoming and supportive environment for all.
      Stay informed about the latest news, updates, and trends in the world of React with our curated selection of articles, blog posts, and resources. From new features and releases to tips and tricks, ReactifyHub keeps you in the loop so you can stay ahead of the curve and continue to level up your React skills.
      </p>
    </div>
  );
};
export default Home;
